import { bindActionCreators } from "redux";

const INITIAL_STATE = {
  user: null,
};

const userReducer = (state = INITIAL_STATE, action) => {
  // reducers updates the state in this case userReducer is the state updater
  switch (action.type) {
    default:
      return state;
  }
};

export default userReducer;
